import { Link, Outlet} from 'react-router-dom '

const Layout = () => {
    return(
        <>
            <div>
                <Link to="/auth">Auth</Link>
                <Link to="/registration">Registration</Link>
            </div>
            <Outlet/>
        </>
    )
}

export {Layout}
